import { LOCALES } from "../locales";

export default {
  [LOCALES.ENGLISH]: {
    hello: "Hello, {name}!",
    login: "Login",
    loginpage: "Login Page",
    register: "Register",
    registerpage: "Register Page",
    home: "Home",
  },
};
